import React, {Component} from 'react';

class FrontPage extends Component {
  render(){
    return (
      <div>
        <div id="bg">
          <img src={require('./imgs/star_background.jpg')}/>
          <div>Hey there</div>
        </div>
        <div>
          <h3 className="butt">Hey I'm Connor!</h3>
        </div>
      </div>
     );
  }

}

export default FrontPage;
